const Homepage = () => {
  return <div>
    <div id = "welcome">
    <h1>UNLESS YOU PUKE, FAINT, OR DIE, KEEP GOING!</h1>
    </div>
    <div id = "image">
    <img src='https://www.muscleandfitness.com/wp-content/uploads/2018/11/Group-Fitness-Class-Performing-A-Variety-Of-Exercises-1.jpg?quality=86&strip=all' alt='banner'/>
    </div>
    </div>
}

export default Homepage;
